export default class HedP extends React.Component {
  state = {
    page: [
      {
        icon: <i class='fas fa-deaf red'></i>,
        title: 'CONDIMENTUM',
        text:
          'Sed porttitor justo magna odio sed lacus nunc consequat sem vel metus imperdiet lacinia suspendisse aliquet mi sed',
        price: '€ 80 pcm',
        button: 'DETAILS',
        id: 1,
      },
    ],
  };

  render() {
    const { page } = this.state;
    return (
      <div className='hedP'>
        <div className='hedP2'>
          <div className='hedP3'>
            <h4>Sagittis Lacus Neque Ut Lorem Integer</h4>
            <p>Elementum nisi ac volutpat vestibulum enim mi tincidunt eros</p>
          </div>
          {page.map((pags) => {
            return (
              <div className='page' id={pags.id}>
                {pags.icon}
                <h4>{pags.title}</h4>
              </div>
            );
          })}
        </div>
      </div>
    );
  }
}
